import './myProfile.scss';
import { Table } from '@mui/material';
import { useTable } from 'react-table';

const MyProfile = () => {

    return ( 
        <div className="myProfile">
            <h1 className="profileTitle">Your Profile</h1>
            <div className="informationContainer">
                <div className="personalInformationWrapper">
                    
                </div>
                <div className="expectInformationWrapper">
                    
                </div>
            </div>
            <div className="yourExpectContainer">
                <h1 className="profileTitle">Your Expects</h1>
                <div className="expects"></div>
            </div>
        </div>
     );
}
 
export default MyProfile;
